CREATE VIEW [dbo].[VOrderSale]
AS
SELECT        dbo.tbOrdersSales.orderDate, dbo.tbOrdersSales.valueAdd, dbo.tbOrdersSales.total, dbo.tbOrdersSales.pay, dbo.tbOrdersSales.stay, dbo.tbOrdersSales.sales, dbo.tbCustomers.name, dbo.tbOrdersSales.id, 
