CREATE VIEW [dbo].[VOrderAll]
AS
SELECT        dbo.tbOrdersSales.id, dbo.tbOrdersSales.orderDate, dbo.tbCustomers.phone, dbo.tbCustomers.name, dbo.tbCustomers.adress, dbo.tbTypeCustomer.typeCustomer, dbo.tbOrdersSalesDetails.productName, 
                         dbo.tbOrdersSalesDetails.price, dbo.tbOrdersSalesDetails.qty, dbo.tbOrdersSalesDetails.descount, dbo.tbOrdersSalesDetails.total AS Amount, dbo.tbOrdersSales.valueAdd, dbo.tbOrdersSales.total, dbo.tbOrdersSales.pay, 
                         dbo.tbOrdersSales.stay, dbo.tbOrdersSales.sales
FROM            dbo.tbCustomers INNER JOIN
                         dbo.tbOrdersSales ON dbo.tbCustomers.phone = dbo.tbOrdersSales.customers INNER JOIN
                         dbo.tbOrdersSalesDetails ON dbo.tbOrdersSales.id = dbo.tbOrdersSalesDetails.idOrder INNER JOIN
                         dbo.tbTypeCustomer ON dbo.tbOrdersSales.typeCustomer = dbo.tbTypeCustomer.id
