CREATE PROCEDURE [dbo].[ProductAddOrEdit]
	@id int,
    @code    VARCHAR (50),
    @name      VARCHAR (50),
    @priceBuy  DECIMAL (9, 2),
    @priceSale DECIMAL (9, 2),
    @priceEarn DECIMAL (9, 2),
    @Qty       DECIMAL (9, 2),
    @idItem    INT 
    -- , 
	-- @image     IMAGE 
AS
--ADD
IF @id=0
	INSERT INTO tbProducts (code,name,priceBuy,priceSale,priceEarn,Qty,idItem)
	values (@code,@name,@priceBuy,@priceSale,@priceEarn,@Qty,@idItem)
ELSE 
--UPDATE
UPDATE tbProducts
SET 
code=@code,
name=@name,
priceBuy=@priceBuy,
priceSale=@priceSale,
priceEarn=@priceEarn,
Qty=@Qty,
idItem=@idItem
WHERE 
id=@id
GO
